import React, { useEffect, useState } from 'react';
import TraineeReport from './TraineeReport';
import TrainerTabBar from './TrainerTabBar';
import './Dashboard.css';
// ‡πÄ‡∏û‡∏¥‡πà‡∏°‡∏™‡πÑ‡∏ï‡∏•‡πå‡∏ò‡∏µ‡∏°‡∏°‡πà‡∏ß‡∏á‡πÅ‡∏ö‡∏ö‡∏´‡∏ô‡πâ‡∏≤ trainee
const themePurple = {
  background: 'linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%)',
  minHeight: '100vh',
  fontFamily: 'Inter, sans-serif',
};

const TrainerDashboard = () => {
  const [videos, setVideos] = useState([]);
  const [summary, setSummary] = useState(null);
  const [traineeReport, setTraineeReport] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState('');
  const [profile, setProfile] = useState({ name: '', email: '', picture: '' });

  useEffect(() => {
    const token = localStorage.getItem('token');
    setIsLoading(true);
    // Fetch all trainers (simulate as trainer's own data for now)
    fetch('http://localhost:8000/trainers', {
      headers: { Authorization: `Bearer ${token}` }
    })
      .then(res => res.json())
      .then(trainers => {
        // Assume the first trainer is the logged-in trainer (for demo)
        const trainer = Array.isArray(trainers) && trainers.length > 0 ? trainers[0] : null;
        if (trainer) {
          setProfile({
            name: trainer.name,
            email: trainer.email,
            picture: '/user (1).png'
          });
          // Fetch trainer profile for more details
          fetch(`http://localhost:8000/trainers/${trainer.id}`, {
            headers: { Authorization: `Bearer ${token}` }
          })
            .then(res => res.json())
            .then(profileData => {
              // Simulate summary and report from profileData
              setSummary({
                most_popular_title: 'N/A',
                most_popular_count: 0,
                total_usage: 0
              });
              setTraineeReport([]); // No trainee report in backend yet
              setVideos([]); // No videos endpoint in backend yet
            })
            .catch(() => setError('‡πÄ‡∏Å‡∏¥‡∏î‡∏Ç‡πâ‡∏≠‡∏ú‡∏¥‡∏î‡∏û‡∏•‡∏≤‡∏î‡πÉ‡∏ô‡∏Å‡∏≤‡∏£‡πÇ‡∏´‡∏•‡∏î‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡πÇ‡∏õ‡∏£‡πÑ‡∏ü‡∏•‡πå‡πÄ‡∏ó‡∏£‡∏ô‡πÄ‡∏ô‡∏≠‡∏£‡πå'))
            .finally(() => setIsLoading(false));
        } else {
          setError('‡πÑ‡∏°‡πà‡∏û‡∏ö‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡πÄ‡∏ó‡∏£‡∏ô‡πÄ‡∏ô‡∏≠‡∏£‡πå');
          setIsLoading(false);
        }
      })
      .catch(() => {
        setError('‡πÄ‡∏Å‡∏¥‡∏î‡∏Ç‡πâ‡∏≠‡∏ú‡∏¥‡∏î‡∏û‡∏•‡∏≤‡∏î‡πÉ‡∏ô‡∏Å‡∏≤‡∏£‡πÇ‡∏´‡∏•‡∏î‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡πÄ‡∏ó‡∏£‡∏ô‡πÄ‡∏ô‡∏≠‡∏£‡πå');
        setIsLoading(false);
      });
  }, []);

  if (isLoading) return <div className="dashboard-loading"><div className="loading-spinner"></div><p>‡∏Å‡∏≥‡∏•‡∏±‡∏á‡πÇ‡∏´‡∏•‡∏î‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•...</p></div>;
  if (error) return <div className="error-message">{error}</div>;

  return (
    <div className="dashboard trainer-dashboard-bg" style={themePurple}>
      {/* Header */}
      <header style={{
        display: 'flex', justifyContent: 'space-between', alignItems: 'center',
        padding: '1.5rem 2.5rem 1rem 2.5rem', background: 'white', boxShadow: '0 2px 8px -2px #a855f722', borderRadius: '0 0 32px 32px', marginBottom: '1.5rem'
      }}>
        <div style={{display: 'flex', alignItems: 'center', gap: '1rem'}}>
          <span style={{fontWeight: 900, fontSize: '2rem', color: '#a855f7', letterSpacing: '-0.03em'}}>FitAddict</span>
        </div>
        <div style={{display: 'flex', alignItems: 'center', gap: '1.25rem'}}>
          {/* Google profile badge */}
          <div style={{display: 'flex', alignItems: 'center', gap: '0.75rem'}}>
            <img src={profile.picture} alt="avatar" style={{width: 40, height: 40, borderRadius: '50%', objectFit: 'cover', background: '#ede9fe'}} onError={e => { e.target.onerror = null; e.target.src = '/user (1).png'; }} />
            <div style={{display: 'flex', flexDirection: 'column'}}>
              <span style={{fontWeight: 600, color: '#334155'}}>{profile.name}</span>
              <span style={{fontSize: '0.95rem', color: '#64748b'}}>{profile.email}</span>
            </div>
          </div>
          <button style={{background: 'linear-gradient(90deg,#a855f7,#6366f1)', color: 'white', fontWeight: 700, border: 'none', borderRadius: 12, padding: '0.5rem 1.25rem', cursor: 'pointer'}}>‡∏≠‡∏≠‡∏Å‡∏à‡∏≤‡∏Å‡∏£‡∏∞‡∏ö‡∏ö</button>
        </div>
      </header>

      {/* Tab Bar */}
  <TrainerTabBar />

      {/* Welcome Section */}
      <section style={{textAlign: 'center', marginBottom: '2.5rem'}}>
        <div style={{background: 'white', borderRadius: 24, boxShadow: '0 2px 12px -2px #a855f722', padding: '2rem 1rem', maxWidth: 900, margin: '0 auto 2rem auto'}}>
          <h2 style={{fontSize: '2rem', fontWeight: 800, color: '#334155', marginBottom: '0.5rem'}}>‡∏¢‡∏¥‡∏ô‡∏î‡∏µ‡∏ï‡πâ‡∏≠‡∏ô‡∏£‡∏±‡∏ö, preeyanut chitkot!</h2>
          <p style={{color: '#64748b', fontSize: '1.15rem'}}>‡∏ô‡∏µ‡πà‡∏Ñ‡∏∑‡∏≠‡∏´‡∏ô‡πâ‡∏≤‡∏™‡∏≥‡∏´‡∏£‡∏±‡∏ö Trainer ‡∏Ñ‡∏∏‡∏ì‡∏™‡∏≤‡∏°‡∏≤‡∏£‡∏ñ‡∏î‡∏π‡∏™‡∏£‡∏∏‡∏õ‡πÅ‡∏•‡∏∞‡∏à‡∏±‡∏î‡∏Å‡∏≤‡∏£‡∏£‡∏∞‡∏ö‡∏ö‡∏Ç‡∏≠‡∏á‡∏Ñ‡∏∏‡∏ì‡πÑ‡∏î‡πâ‡∏ó‡∏µ‡πà‡∏ô‡∏µ‡πà</p>
        </div>
      </section>

      {/* Card Section */}
      <section style={{display: 'flex', justifyContent: 'center', gap: '2rem', marginBottom: '2.5rem', flexWrap: 'wrap'}}>
        <div style={{background: 'white', borderRadius: 18, boxShadow: '0 4px 12px -2px #a855f722', minWidth: 280, padding: '1.5rem 1.25rem', flex: '1 1 280px', maxWidth: 350}}>
          <h3 style={{fontWeight: 700, color: '#334155', marginBottom: '0.5rem'}}>‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠‡∏Ç‡∏≠‡∏á‡∏Ñ‡∏∏‡∏ì</h3>
          <p style={{color: '#64748b', marginBottom: '1rem'}}>‡∏î‡∏π‡πÅ‡∏•‡∏∞‡∏à‡∏±‡∏î‡∏Å‡∏≤‡∏£‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠‡∏ó‡∏µ‡πà‡∏Ñ‡∏∏‡∏ì‡∏≠‡∏±‡∏û‡πÇ‡∏´‡∏•‡∏î</p>
          <button style={{background: 'linear-gradient(90deg,#a855f7,#6366f1)', color: 'white', fontWeight: 700, border: 'none', borderRadius: 12, padding: '0.5rem 1.25rem', cursor: 'pointer'}}>‡∏î‡∏π‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠‡∏ó‡∏±‡πâ‡∏á‡∏´‡∏°‡∏î</button>
        </div>
        <div style={{background: 'white', borderRadius: 18, boxShadow: '0 4px 12px -2px #a855f722', minWidth: 280, padding: '1.5rem 1.25rem', flex: '1 1 280px', maxWidth: 350}}>
          <h3 style={{fontWeight: 700, color: '#334155', marginBottom: '0.5rem'}}>Invite Trainee</h3>
          <p style={{color: '#64748b', marginBottom: '1rem'}}>‡πÄ‡∏ä‡∏¥‡∏ç‡∏ú‡∏π‡πâ‡πÉ‡∏ä‡πâ‡πÉ‡∏´‡∏°‡πà‡πÄ‡∏Ç‡πâ‡∏≤‡∏£‡∏∞‡∏ö‡∏ö‡∏Ç‡∏≠‡∏á‡∏Ñ‡∏∏‡∏ì</p>
          <button style={{background: 'linear-gradient(90deg,#a855f7,#6366f1)', color: 'white', fontWeight: 700, border: 'none', borderRadius: 12, padding: '0.5rem 1.25rem', cursor: 'pointer'}}>‡πÄ‡∏ä‡∏¥‡∏ç‡∏ú‡∏π‡πâ‡πÉ‡∏ä‡πâ</button>
        </div>
        <div style={{background: 'white', borderRadius: 18, boxShadow: '0 4px 12px -2px #a855f722', minWidth: 280, padding: '1.5rem 1.25rem', flex: '1 1 280px', maxWidth: 350}}>
          <h3 style={{fontWeight: 700, color: '#334155', marginBottom: '0.5rem'}}>Trainee</h3>
          <p style={{color: '#64748b', marginBottom: '1rem'}}>‡∏î‡∏π‡∏£‡∏≤‡∏¢‡∏á‡∏≤‡∏ô‡∏ú‡∏π‡πâ‡πÄ‡∏Ç‡πâ‡∏≤‡∏≠‡∏ö‡∏£‡∏°‡∏Ç‡∏≠‡∏á‡∏Ñ‡∏∏‡∏ì</p>
          <button style={{background: 'linear-gradient(90deg,#a855f7,#6366f1)', color: 'white', fontWeight: 700, border: 'none', borderRadius: 12, padding: '0.5rem 1.25rem', cursor: 'pointer'}}>‡∏î‡∏π‡∏£‡∏≤‡∏¢‡∏á‡∏≤‡∏ô‡∏ú‡∏π‡πâ‡πÄ‡∏Ç‡πâ‡∏≤‡∏≠‡∏ö‡∏£‡∏°</button>
        </div>
      </section>

      {/* Dashboard analytics and trainee report sections */}
      <>
        {/* Row 1: Video + Analytics */}
        <section className="trainer-section" style={{marginBottom: '2.5rem'}}>
          <div className="dashboard-row" style={{display: 'flex', justifyContent: 'center', alignItems: 'flex-start', gap: '1.5rem', maxWidth: 1100, margin: '0 auto'}}>
            {/* Video card */}
            {videos.length === 0 ? (
              <div className="stat-card" style={{background: 'rgba(255,255,255,0.95)', border: '2px solid #e9d5ff', boxShadow: '0 4px 12px -2px #a855f722', borderRadius: 18, minWidth: 280, maxWidth: 350, flex: '1 1 280px'}}>
                <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠‡∏Ç‡∏≠‡∏á‡∏Ñ‡∏∏‡∏ì (‡∏£‡∏≤‡∏¢‡∏•‡∏∞‡πÄ‡∏≠‡∏µ‡∏¢‡∏î)</h2>
                <h3 style={{color: '#7c3aed', fontWeight: 700}}>‡∏ï‡∏±‡∏ß‡∏≠‡∏¢‡πà‡∏≤‡∏á‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠</h3>
                <div style={{display: 'flex', alignItems: 'center', gap: '0.5rem'}}>
                  <p style={{color: '#64748b', marginBottom: 0}}>‡∏ñ‡∏π‡∏Å‡πÉ‡∏ä‡πâ 12 ‡∏Ñ‡∏£‡∏±‡πâ‡∏á</p>
                  <span className="popular-badge" style={{background: 'linear-gradient(90deg,#a855f7,#6366f1)', color: 'white', padding: '0.25rem 0.75rem', borderRadius: 12, fontWeight: 600, fontSize: '0.95rem'}}>üî• Popular</span>
                </div>
              </div>
            ) : (
              videos.map(v => (
                <div className="stat-card video-card" key={v.id} style={{background: 'rgba(255,255,255,0.95)', border: '2px solid #e9d5ff', boxShadow: '0 4px 12px -2px #a855f722', borderRadius: 18, minWidth: 280, maxWidth: 350, flex: '1 1 280px'}}>
                  <h2 className="trainer-section-title" style={{color: '#6366f1', fontSize: '1.25rem', marginBottom: '1rem'}}>‡∏ß‡∏¥‡∏î‡∏µ‡πÇ‡∏≠‡∏Ç‡∏≠‡∏á‡∏Ñ‡∏∏‡∏ì (‡∏£‡∏≤‡∏¢‡∏•‡∏∞‡πÄ‡∏≠‡∏µ‡∏¢‡∏î)</h2>
                  <h3 style={{color: '#7c3aed', fontWeight: 700}}>{v.title}</h3>
                  <p style={{color: '#64748b'}}>‡∏ñ‡∏π‡∏Å‡πÉ‡∏ä‡πâ {v.usage_count} ‡∏Ñ‡∏£‡∏±‡πâ‡∏á</p>
                  {v.is_popular && <span className="popular-badge" style={{background: 'linear-gradient(90deg,#a855f7,#6366f1)', color: 'white', padding: '0.25rem 0.75rem', borderRadius: 12, fontWeight: 600, fontSize: '0.95rem'}}>üî• Popular</span>}
                </div>
              ))
            )}
            {/* Analytics cards */}
            {summary ? (
              <>
